INSERT INTO `news` (`id`, `title`, `pageURL`, `thumbURL`, `description`, `keywords`, `clicks`) VALUES
(1, 'Donald Trump\'s India visit a blessing in disguise for Satya Nadella', 'https://www.livemint.com/companies/people/donald-trump-s-india-visit-a-blessing-in-disguise-for-satya-nadella-11582513719654.html', 'https://images.livemint.com/img/2020/02/24/600x338/2020-02-20T144623Z_1_LYNXMPEG1J1C4_RTROPTP_3_MEXICO-MICROSOFT_1582513986010_1582514000294.JPG', 'Microsoft CEO Satya Nadella, who courted a big controversy by saying "CAA is just bad for India" at a tech event last month, begins his three-day India trip from Monday while US President Donald Trump has ensured that all the space across media outlets goes to him.', 'microsoft, trump, CAA, nadella', 0),
(2, 'Google CEO Sundar Pichai is taking over as CEO of Alphabet', 'https://techcrunch.com/2019/12/03/sundar-pichai-alphabet-ceo/', 'https://techcrunch.com/wp-content/uploads/2018/12/GettyImages-1071785212.jpg?w=120&crop=1', 'Google founders Larry Page and Sergey Brin just announced that Google CEO Sundar Pichai will be replacing Page as the CEO of parent company Alphabet.', 'google ceo, alphabet ceo, sundar pichai, sunder google', 1),
(3, 'Mastercard CEO Ajay Banga to step down as company\'s Chief Product Officer named new chief\r\n\r\nRead more at: https://yourstory.com/2020/02/mastercard-names-new-ceo-ajay-banga', 'https://yourstory.com/2020/02/mastercard-names-new-ceo-ajay-banga', 'https://images.yourstory.com/cs/2/bd251c602d6a11e9aa979329348d4c3e/Imageh1i1156396395845711573527207195png?fm=png&auto=format', 'Mastercard\'s Indian American President and Chief Executive Officer Ajay Banga will step down from his role and assume charge as Executive Chairman of the Board of Directors, as the payments giant announced Michael Miebach as the new CEO.', 'ajay bhanga, ceo mastercard', 0),
(4, '\r\nRadisson CEO Plays Down Coronavirus Impact on Hotels', 'https://skift.com/2020/02/25/radisson-ceo-plays-down-coronavirus-impact-on-hotels/', 'NULL', 'Federico Gonzalez, the CEO of Radisson Hospitality AB, the European arm of the Radisson Hotel Group, has moved to downplay the impact of the coronavirus outbreak on the company.', 'ceo, radisson, chief executive officer', 1);
