(236, 'https://hsnaples.org/adopt-a-dog/', 'Adopt A Dog | Humane Society Naples No-Kill Animal Shelter', 'There are many adoptable dogs available at the Humane Society Naples. A non-profit, no kill animal shelter in Collier County. Adopt a Dog Today!', 'adopt, dog, doggy, adopt a pet, adoptable dog', 0),
