(248, 'https://en.wikipedia.org/wiki/Dog', 'Dog - Wikipedia', 'The domestic dog (Canis lupus familiaris when considered a subspecies of the wolf or Canis familiaris when considered a distinct species) is a member of the genus Canis (canines), which forms part of the wolf-like canids, and is the most widely abundant terrestrial carnivore.', 'dog wiki, information about dog, dog info', 0),
(249, 'https://www.nationalgeographic.com/animals/mammals/d/domestic-dog/', 'Dog | National Geographic', 'Dogs were probably the first tame animals. They have accompanied humans for at least 20,000 years and possibly as many as 40,000. Scientists generally agree that all dogs, domestic and wild, share a common wolf ancestor; at some point grey wolves and dogs went on their separate evolutionary ways.', 'nat geo dog', 0),
(251, 'https://en.wikipedia.org/wiki/Facebook', 'Facebook - Wikipedia', 'Facebook (FB) is an American online social media and social networking service based in Menlo Park, California and a flagship service of the namesake company Facebook, Inc. It was founded by Mark Zuckerberg, along with fellow Harvard College students and roommates Eduardo Saverin, Andrew McCollum, Dustin Moskovitz and Chris Hughes.', 'facebook wiki,facebook info, facebook owner, facebook company', 5),
