(253, 'https://www.vocabulary.com/dictionary/absence', 'absence - Dictionary Definition : Vocabulary.com', 'Absence is the state of not being someplace, like school. It can also refer to the amount of time something has been, or plans to be gone.', 'absence, absence meaning', 0),
