INSERT INTO `videos` (`id`, `title`, `videoURL`, `thumbURL`, `description`, `keywords`, `clicks`, `broken`) VALUES
(1, 'How to make an HD game in java using Netbeans? - YouTube', 'https://www.youtube.com/watch?v=GfbDqMrhBmo', 'https://i.ytimg.com/vi/GfbDqMrhBmo/hqdefault.jpg?sqp=-oaymwEZCNACELwBSFXyq4qpAwsIARUAAIhCGAFwAQ==&rs=AOn4CLB_j4FDGRMGOj7dvvlDBtjOq0kV4Q', 'Casino Game in java? Better say HD game in java aren\'t hard enough to make. So if you want to know how to make an HD game in java or how to make a simple game in java using netbeans then please watch the entire video. No clickbait dude.', 'create a game in java, create a hd game in netbeans, java game', 1, 0),
(2, 'How to Create a MAZE PLATFORMER game using GameMaker? - Youtube', 'https://www.youtube.com/watch?v=UCToxOcUjcc', 'https://i.ytimg.com/vi/UCToxOcUjcc/hqdefault.jpg?sqp=-oaymwEZCNACELwBSFXyq4qpAwsIARUAAIhCGAFwAQ==&rs=AOn4CLDeajFBNNzzttB3h5aJ8wUpuKfF5g', '\r\n\r\nIn this video I\'ll show you how to create a platformer game in GameMaker. Please watch the full video.\r\nLink: http://bit.ly/2ukC4Ob', 'gamemaker patformer, make a maze game in gamemaker 8.1', 2, 0),
(3, 'Australia fires: Debunking \'arson emergency\' claims - BBC News', 'https://www.youtube.com/watch?v=aDvmAMsYwNY', 'https://i.ytimg.com/vi/aDvmAMsYwNY/hqdefault.jpg?sqp=-oaymwEZCNACELwBSFXyq4qpAwsIARUAAIhCGAFwAQ==&rs=AOn4CLDK-KOqw1PWnzgdgYtAEkqO_Oc3xQ', 'The past week has seen a surge of claims on social media that arson is to blame for most of Australia\'s massive bushfires.\r\nBut these have mostly been based on inaccurate reporting of police figures, as BBC Outside Source\'s Ros Atkins explains.', 'bbc australia, bbc news', 1, 0),
(4, 'Iran\'s Supreme Leader: \'We slapped them on the face\' - BBC News', 'https://www.youtube.com/watch?v=eB7oGTmsz6k', 'https://i.ytimg.com/vi/eB7oGTmsz6k/hqdefault.jpg?sqp=-oaymwEZCNACELwBSFXyq4qpAwsIARUAAIhCGAFwAQ==&rs=AOn4CLBipo-pIkckFXd169ADjS601Ua3DA', 'Speaking at an event commemorating the 1978 Qom protest - a key event leading up to the Islamic Revolution - Iran’s Supreme Leader Ayatollah Ali Khamenei says “the country is equipped today against the bullies of the world”.', 'iran usa, usa war, iran war, Qasem Soleimani death, usa missile bombing', 1, 0),
(5, 'Iran president: US \'feet will be cut off from region\' - BBC News', 'https://www.youtube.com/watch?v=mzR3rs1qFu4', 'https://i.ytimg.com/vi/mzR3rs1qFu4/hqdefault.jpg?sqp=-oaymwEZCNACELwBSFXyq4qpAwsIARUAAIhCGAFwAQ==&rs=AOn4CLAnx4w5tpX0Ff4Y5PRgZW3J5tlp2Q', 'Iranian President Hassan Rouhani warns the US that its forces will be removed from the Middle East following the killing of Qasem Soleimani.\r\n\r\n"You cut off Soleimani\'s hand from his body, your feet will be cut off from the region," Iranian media quote him as telling a cabinet meeting.\r\n', 'qasem soleimani, usa iran war, usa military forces', 1, 0),
(6, 'India university attack: \'I thought I was going to die\' - BBC News', 'https://www.youtube.com/watch?v=3ALXhyjPO5k', 'https://i.ytimg.com/vi/3ALXhyjPO5k/hqdefault.jpg?sqp=-oaymwEZCPYBEIoBSFXyq4qpAwsIARUAAIhCGAFwAQ==&rs=AOn4CLBbsthVj3dqFIU4q9gAYvP-4RgNKQ', 'More than 100 masked men wielding sticks and rods attacked students and teachers of Delhi\'s prestigious Jawaharlal Nehru University on Sunday.\r\n\r\nVideos of the violence quickly spread via WhatsApp and were then broadcast on television, sparking shock and outrage across India.', 'jnu university violence, Jawaharlal Nehru University violence', 2, 0),
(7, 'Qasem Soleimani: Iran rolls back nuclear deal commitments- BBC News', 'https://www.youtube.com/watch?v=DbEUp2gWM0E', 'https://i.ytimg.com/vi/DbEUp2gWM0E/hqdefault.jpg?sqp=-oaymwEZCPYBEIoBSFXyq4qpAwsIARUAAIhCGAFwAQ==&rs=AOn4CLB_XpGXQ08AmFdh7u1T25Bke6IL_g', 'Iran has declared it will no longer abide by any of the restrictions imposed by the 2015 nuclear deal.\r\n<br/>\r\nIn a statement it said it would no longer observe limitations on its capacity for enrichment, the level of enrichment, the stock of enriched material, or research and development.', 'iran nuclear deal rollback', 0, 0),
(8, 'Qasem Soleimani: Iran vows \'severe revenge\' over general\'s killing - BBC News', 'https://www.youtube.com/watch?v=U1NlLK9BPaU', 'https://i.ytimg.com/vi/U1NlLK9BPaU/hqdefault.jpg?sqp=-oaymwEZCNACELwBSFXyq4qpAwsIARUAAIhCGAFwAQ==&rs=AOn4CLCrGgr87vuEgLvUsWZ9YuPsmAiXXw', 'General Qasem Soleimani, head of the Iranian Revolutionary Guards\' elite Quds Force, has been killed by US forces in Iraq', 'iran usa war', 0, 0),
(9, 'Qasem Soleimani: Strike was to \'stop war\', says Trump - BBC News', 'https://www.youtube.com/watch?v=15R3DB8AyVs', 'https://i.ytimg.com/vi/15R3DB8AyVs/hqdefault.jpg?sqp=-oaymwEZCPYBEIoBSFXyq4qpAwsIARUAAIhCGAFwAQ==&rs=AOn4CLCE4SQKmwBbBwVy6FWzz0Avks2BlQ', 'President Donald Trump said the US killed Iran\'s top military commander Qasem Soleimani "to stop a war, not to start one".', 'usa iran war', 0, 0),
(10, 'Pope\'s annoyance over arm yank - BBC News', 'https://www.youtube.com/watch?v=qt32tk9Ckyg', 'https://i.ytimg.com/vi/qt32tk9Ckyg/hqdefault.jpg?sqp=-oaymwEZCNACELwBSFXyq4qpAwsIARUAAIhCGAFwAQ==&rs=AOn4CLA0OH599GI7L6BAZQdxbdPYEsdTzA', 'Pope Francis has showed his displeasure towards a visitor in St Peter\'s Square on New Year\'s Eve.\r\n<br/>\r\nHe had been greeting pilgrims when he admonished a woman for grabbing his hand.', 'pope francis annoyed', 1, 0),
(11, 'A Chinese knight fighting for his dream - BBC News', 'https://www.youtube.com/watch?v=HQ4YkaPGlrw', 'https://i.ytimg.com/vi/HQ4YkaPGlrw/hqdefault.jpg?sqp=-oaymwEZCPYBEIoBSFXyq4qpAwsIARUAAIhCGAFwAQ==&rs=AOn4CLA9lDB3e8Jz2gwNPPzXfkS4mzBYHQ', 'By day, Lu Qi is a kindergarten teacher in Shanghai. At night, he transforms into a warrior knight when he competes in medieval combat.\r\n\r\nThe sport involves players wearing replica medieval armour fighting one another with real weapons.', 'fighting', 0, 0),
(12, '\'I sent my seven-year-old across the border alone\' - BBC News', 'https://www.youtube.com/watch?v=4b5eAdkVLHA', 'https://i.ytimg.com/vi/4b5eAdkVLHA/hqdefault.jpg?sqp=-oaymwEZCNACELwBSFXyq4qpAwsIARUAAIhCGAFwAQ==&rs=AOn4CLBK4LjQ9WQbwH6-hF7fEgUdf6IvRg', 'More parents are resorting to sending their children across the US-Mexico border alone in a bid to get around asylum rules.', '', 0, 0),
(13, 'India Citizenship Act protests: \'Our son was shot dead by police\' - BBC News', 'https://www.youtube.com/watch?v=ZLEnPj8ZN_A', 'https://i.ytimg.com/vi/ZLEnPj8ZN_A/hqdefault.jpg?sqp=-oaymwEZCPYBEIoBSFXyq4qpAwsIARUAAIhCGAFwAQ==&rs=AOn4CLBAVxr5QVpDWdzdQgzqbe_x-n4h0A', 'At least 19 people have died in the Indian state of Uttar Pradesh in recent weeks amid violent protests over a controversial new citizenship law.\r\n<br/>\r\nThe police are accused of using excessive force, and Muslims say they fear losing their rights in the world\'s largest democracy.', 'caa protests, caa nrc protest in india', 0, 0),
(14, 'Refugee camps: Pregnant and living in a wet tent - BBC News', 'https://www.youtube.com/watch?v=pUcHlpS41A0', 'https://i.ytimg.com/vi/pUcHlpS41A0/hqdefault.jpg?sqp=-oaymwEZCPYBEIoBSFXyq4qpAwsIARUAAIhCGAFwAQ==&rs=AOn4CLB1hsII4Y6XqGPC7iHQZHFrtz_iuA', 'The medical charity Médecins Sans Frontières says a health emergency is unfolding as refugee camps on the Aegean islands see a spike in new arrivals from war torn countries. In Lesbos – almost 18,000 people are crammed into a camp that was originally built for around 2000 people. ', 'refugee camps, greece immigrants', 0, 0),
(15, 'Lesbos migrant camp children \'say they want to die\' - BBC News', 'https://www.youtube.com/watch?v=oL6HLA7JxoY', 'https://i.ytimg.com/vi/oL6HLA7JxoY/hqdefault.jpg?sqp=-oaymwEZCPYBEIoBSFXyq4qpAwsIARUAAIhCGAFwAQ==&rs=AOn4CLCTDTmdvDPP66A0DbpVBWpZN0aVWQ', '\r\nThis December ministers from around the world have been meeting for the first forum on refugees in Geneva, but the BBC has been told of an increasing number of children are self-harming and attempting suicide in the Greek refugee camp of Lesbos. There\'s been a spike in refugees arriving on the Aegean islands in recent months, the vast majority are fleeing countries of conflict (85% from Afghanistan, Syria, Iraq, Somali, DRC - UNHCR)', 'immigrant problem in greece, greece refugee camps', 0, 0),
(16, 'The Citizenship law causing nationwide protests in India - BBC News', 'https://www.youtube.com/watch?v=H2-Xny8pabA', 'https://i.ytimg.com/vi/H2-Xny8pabA/hqdefault.jpg?sqp=-oaymwEZCPYBEIoBSFXyq4qpAwsIARUAAIhCGAFwAQ==&rs=AOn4CLAEji-gUQuuHG4uWscoL1jIzjl2tw', 'Violent protests have left several people dead as rallies continue in several cities across India.\r\n<br/>\r\nThe protests started after the country passed a Citizenship Amendment Act which some said is anti-Muslim.', 'caa protests', 0, 0),
(17, 'Stateless in Assam - BBC News', 'https://www.youtube.com/watch?v=veeJFuluaJ0', 'https://i.ytimg.com/vi/veeJFuluaJ0/hqdefault.jpg?sqp=-oaymwEZCPYBEIoBSFXyq4qpAwsIARUAAIhCGAFwAQ==&rs=AOn4CLAScup_k-DSs_dhJfI9oK4a7FdgBQ', '\r\nThis summer, India published a list which effectively stripped about 1.9 million people in the north-eastern state of Assam of their citizenship. ', 'nrc assam', 0, 0),
(18, 'Iran crisis: How will US-Iran relations play out in 2020? - BBC News', 'https://www.youtube.com/watch?v=dkdszuquUF4', 'https://i.ytimg.com/vi/dkdszuquUF4/hqdefault.jpg?sqp=-oaymwEZCNACELwBSFXyq4qpAwsIARUAAIhCGAFwAQ==&rs=AOn4CLCHOBtYjcaT-qATHfyG2YCXXCmqpA', 'The assassination by the US of Iran\'s most powerful general, Qasem Soleimani, has caused an escalation in tensions between the two countries.', 'iran crisis, usa iran war', 0, 0),
(19, 'Iran plane crash: Western powers suggest missile downed jet - BBC News', 'https://www.youtube.com/watch?v=f9pU6tabM2Y', 'https://i.ytimg.com/vi/f9pU6tabM2Y/hqdefault.jpg?sqp=-oaymwEZCNACELwBSFXyq4qpAwsIARUAAIhCGAFwAQ==&rs=AOn4CLDF7VKpZ5aT2Ed1yz3ZqKt9Hxbcdg', 'The assassination by the US of Iran\'s most powerful general, Qasem Soleimani, has caused an escalation in tensions between the two countries.', '', 0, 0),
(20, 'Are Europe\'s rape laws letting women down? - BBC News', 'https://www.youtube.com/watch?v=wVV91PjFI0w', 'https://i.ytimg.com/vi/wVV91PjFI0w/hqdefault.jpg?sqp=-oaymwEZCNACELwBSFXyq4qpAwsIARUAAIhCGAFwAQ==&rs=AOn4CLCyDoo3vU0IqVdB3FVX0E-i-bC4Zw', 'Women across Europe have taken to the streets over the past year to demand their governments do more to protect them from sexual violence.', 'rape laws in denmark', 0, 0),
(21, 'Ukrainian passenger plane crashes in Iran - BBC News', 'https://www.youtube.com/watch?v=hkvX6VXwuCU', 'https://i.ytimg.com/vi/hkvX6VXwuCU/hqdefault.jpg?sqp=-oaymwEZCPYBEIoBSFXyq4qpAwsIARUAAIhCGAFwAQ==&rs=AOn4CLBYA3CBATGFG9TexenqdwLKQiTqHw', 'A Ukrainian Boeing-737 with more than 170 people on board has crashed in Iran, officials say.\r\n<br/>\r\nIran\'s Red Crescent said there was no chance of finding survivors.', '', 0, 0),
(22, 'Qasem Soleimani: Huge crowds pack Tehran for commander\'s funeral - BBC News', 'https://www.youtube.com/watch?v=Q1fJ8KIGkoE', 'https://i.ytimg.com/vi/Q1fJ8KIGkoE/hqdefault.jpg?sqp=-oaymwEZCPYBEIoBSFXyq4qpAwsIARUAAIhCGAFwAQ==&rs=AOn4CLC5yzr8YlQyHsVSKCLKvp3MOc8fug', 'Huge crowds have packed the streets of the Iranian capital Tehran for the funeral of Iranian military commander Qasem Soleimani.', '', 0, 0);
